import React from "react";

export const UserList:React.FC = ({users}) => {
  return (
    <div>
        <h6>
          List of users fetched from jsonplaceholder:
        </h6>
        <div>
          <div>
            {users.map((user) => (
              <div key={user.id}>
                <span>{user.name}</span>
              </div>
            ))}
          </div>
        </div>
     </div>
  );
};
